import React from 'react'

const Api = 'https://swapi.co/api/people/1'

export default class Starwars extends React.Component {
    constructor(){
        super()
        this.state={
          person : ""
        }
      }
      componentDidMount() {
        fetch(Api)
          .then(response => response.json())
          .then(data => {
              let person = data.response.map((item) => {
              return(
              <p>{item.name}</p>
              )
          })
          this.setState({person: person})
          console.log(this.state.person + "reere")
        }
        )       

    }
    render(){
        return (
        <div>
            <h1>
            jhjhj{this.state.person}
            </h1>
        </div>)
    }
}
